import React, { Component } from 'react';
import 'bootstrap';

export class Navbar extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-sm-6">Img</div>
                <div className="col-sm-6">Letras</div>
            </div>
        );
    }
}

export default Navbar;
